import React from 'react';
import { Table } from 'react-bootstrap';

function Maestros() {
    const maestros = [
        { id: 1, nombre: 'Joel', apellido: 'Lara', materia: 'Programacion Reactiva' },
        { id: 2, nombre: 'Juan', apellido: 'Zamora', materia: 'Inteligencia Artifical' },
        { id: 3, nombre: 'Yadis', apellido: 'None', materia: 'Java' },
        { id: 4, nombre: 'Manuel', apellido: 'None', materia: 'Base de datos' }
      ];
    
      return (
        <>
        <h2 className='text-center'>Lista de Maestros</h2>
       
        <Table striped bordered hover>
            
          <thead>
            <tr>
              <th>#</th>
              <th>Nombre</th>
              <th>Apellido</th>
              <th>Materia</th>
            </tr>
          </thead>
          <tbody>
            {maestros.map((maestro, index) => (
              <tr key={index}>
                <td>{maestro.id}</td>
                <td>{maestro.nombre}</td>
                <td>{maestro.apellido}</td>
                <td>{maestro.materia}</td>
              </tr>
            ))}
          </tbody>
        </Table>
        </>
      );
    }


export default Maestros;
